import * as React from 'react';

import Beer from './beer';

interface BeerContainer {
    beers: Array<Beer>
};

export default class BeerList extends React.Component {

    constructor(props:string[]) {
        super({beers:Array.from(props).map((s, i) => new Beer(s)).push(new Beer("corona"))});
    }

    render () {
        // @ts-ignore
        return (
            <div>
                {Array.from(this.props.children).map((b: Beer) => (
                    <li>{b}</li>
                ))}
            </div>
    );
    }
}
